import "./App.css";
RecipesProvider
import Navbar from "./components/Navbar";
import Home from "./pages/home";
import MealDetails from "./pages/details";
import { RecipesProvider } from "./services/Context";


function App() {
  return (
    <RecipesProvider>
      <Router> {/* Cambiamos a BrowserRouter */}
        <div className="App">
          <Navbar />
          <MealDetails></MealDetails>
          <Routes>
            <Route path="/" element={<Home />} />

          </Routes>
        </div>
      </Router>
    </RecipesProvider>
  );
}

export default App;
